import React from 'react';

function Gallery() {
    const imagesColumn1 = [
        '/assets/images/gallery/Maskimage1.jpg',
        '/assets/images/gallery/Maskimage4.jpg',
        '/assets/images/gallery/Maskimage7.jpg',
    ];

    const imagesColumn2 = [
        '/assets/images/gallery/Maskimage2.jpg',
        '/assets/images/gallery/Maskimage5.jpg',
        '/assets/images/gallery/Maskimage8.jpg',
        '/assets/images/gallery/Maskimage10.jpg',
    ];

    const imagesColumn3 = [
        '/assets/images/gallery/Maskimage3.jpg',
        '/assets/images/gallery/Maskimage6.jpg',
        '/assets/images/gallery/Maskimage9.jpg',
        '/assets/images/gallery/Maskimage11.png',
    ];

    return (
        <section className="gallery">
            <h2>Gallery</h2>
            <p>memories our customers shared with us</p>
            <div className="gallery-grid">
                <div className="gallery-column">
                    {imagesColumn1.map((image, index) => (
                        <div key={index} className="gallery-item">
                            <img src={image} alt={`Gallery item ${index + 1}`} />
                        </div>
                    ))}
                </div>
                <div className="gallery-column">
                    {imagesColumn2.map((image, index) => (
                        <div key={index} className="gallery-item">
                            <img src={image} alt={`Gallery item ${index + 4}`} />
                        </div>
                    ))}
                </div>
                <div className="gallery-column">
                    {imagesColumn3.map((image, index) => (
                        <div key={index} className="gallery-item">
                            <img src={image} alt={`Gallery item ${index + 8}`} />
                        </div>
                    ))}
                </div>
            </div>
            <button className="view-more">View More</button>
        </section>
    );
}

export default Gallery;
